    if (routeFrom == "Case") {
      this.oneCase = this.$route.params.oneCase;
      localStorage.oneCase = JSON.stringify(this.oneCase);
    } else {
      this.oneCase = JSON.parse(localStorage.oneCase);
    }

    console.log("beforMount caseDetail" + this.oneCase);
